  <script>   setTimeout(() => {
          var favicon_video_image_counter = 0;
          var favicon_video_icon_tag = document.querySelector("link[rel='icon']");
          var favicon_video_images = [
      "https://favicongenerator.s3.amazonaws.com/344a337bf5492.png","https://favicongenerator.s3.amazonaws.com/582a34c5b03fa.png","https://favicongenerator.s3.amazonaws.com/47a9ea5793b79.png","https://favicongenerator.s3.amazonaws.com/524c789b9f53b.png","https://favicongenerator.s3.amazonaws.com/c8352fbba16f2.png","https://favicongenerator.s3.amazonaws.com/85766a3e1ee02.png","https://favicongenerator.s3.amazonaws.com/06d0a89727972.png","https://favicongenerator.s3.amazonaws.com/0fc4f318c4e0c.png","https://favicongenerator.s3.amazonaws.com/8481fb1b2b483.png","https://favicongenerator.s3.amazonaws.com/c8eec6875716.png","https://favicongenerator.s3.amazonaws.com/5caf4a2180a37.png","https://favicongenerator.s3.amazonaws.com/0289d12d902f7.png","https://favicongenerator.s3.amazonaws.com/bc77cfc4a2f7b.png","https://favicongenerator.s3.amazonaws.com/8c2ffa65a377b.png","https://favicongenerator.s3.amazonaws.com/816a396264299.png","https://favicongenerator.s3.amazonaws.com/7e544ce62312c.png","https://favicongenerator.s3.amazonaws.com/7e409f02fd2a.png","https://favicongenerator.s3.amazonaws.com/1eef203df7e79.png","https://favicongenerator.s3.amazonaws.com/5f60d67f9eb22.png","https://favicongenerator.s3.amazonaws.com/4a0202171ba9.png","https://favicongenerator.s3.amazonaws.com/f62d21c69ffe1.png","https://favicongenerator.s3.amazonaws.com/eff84ca7ae62b.png","https://favicongenerator.s3.amazonaws.com/2c8f8a6ab5d7b.png"];
          async function favicon_video_to_data_url(url, callback) {
            var xhr = new XMLHttpRequest();
            xhr.onload = function () {
              var reader = new FileReader();
              reader.onloadend = function () {
                callback(reader.result);
              };
              reader.readAsDataURL(xhr.response);
            };
            xhr.open("GET", url);
            xhr.responseType = "blob";
            xhr.send();
          }
      
          var favicon_video_loaded_images = [];
      
          favicon_video_images.map((url, idx) => {
            favicon_video_to_data_url(url, function (dataUrl) {
              favicon_video_loaded_images[idx] = dataUrl;
            });
          });
      
          setInterval(function () {
            if(favicon_video_loaded_images[favicon_video_image_counter]) {
              favicon_video_icon_tag.href = favicon_video_loaded_images[
                favicon_video_image_counter
              ].replace("application/octet-stream", "image/png");
            }
            if (
              favicon_video_image_counter ==
              favicon_video_loaded_images.length - 1
            )
              favicon_video_image_counter = 0;
            else favicon_video_image_counter++;
          }, 100);
        }, 2000);</script>
